import React from "react";
import { Route } from "react-router-dom";
import CollectionOverview from "../../Components/collectionOverview/CollectionOverview";

const Shop = ({ match }) => {
  return (
    <div className="shop-page">
      <Route exact path={`${match.path}`} />
    </div>
  );
};

export default Shop;
